import React from 'react';
import Idea from '../../componentes/idea/Idea';
import { IdeaProvider } from '../../context/idea.context';

import Comments from '../../componentes/comentarios/Comments';








export default <IdeaProvider><IdeaIndividual></IdeaIndividual></IdeaProvider>
const IdeaIndividual = () => {
  const idea=   {
    id: 230,
    titulo: 'Salir el sabado y encontrar trabajo',
    descripcion: 'Esto es la fucnkin mierda',
    autor:'Brian'
    ,
    votos: 3000
}
  return (
    <div className='container'>
  <Idea datos={idea}/>
<Comments ideaID={idea.id}></Comments>
    </div>
  )
}
